function App() {

  return (
    <div className="App">
        <Routes>
          <Route index element={<Home/>}/>
          <Route path='/my-friends' element={<UserList users={users}/>}/>
          <Route path='/users/:userId' element={<User users={users}/>}/>
          {/*
          <Route path='/pubs' element={<Pubs/>}/>
